INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1, 2, '2017-06-13 07:20:53', 'New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017', 'As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n', 'https://magento.com/tech-resources/download ', 0, 0),
(2, 2, '2017-09-11 11:52:53', 'USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017', 'USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Patches addressing this issue are available on the Magento Open Source download page. More information about the issue is available in a Technical Bulletin at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ', 'http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ', 0, 0),
(3, 1, '2017-09-15 06:50:16', 'Magento Open Source 1.9.3.6 and SUPEE-10266 Security Enhancements – 9/14/2017', 'Magento Open Source 1.9.3.6 and SUPEE-10266 include critical security enhancements. Please update your site as soon as possible. More information is available in the release notes: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html.\n', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(4, 4, '2017-09-26 11:42:02', 'Magento Open Source 2.2 Delivers Enhanced Commerce Capabilities – 9/26/2017', 'Magento Open Source 2.2 includes a range of platform enhancements, including a new deployment process that minimizes production downtime, optimized performance, platform updates that improve developer experience, and Magento Social marketing tools. Learn more at http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html.\n\n', 'http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html ', 0, 0),
(5, 4, '2017-10-17 02:09:36', 'Join us for an exclusive B2B merchant event in Chicago!', 'Transform your business at the Magento B2B Experience on November 2 in Chicago. \n\nNetwork with industry leaders, B2B merchants, and partners to gain insights on B2B best practices, and to discover how to create powerful buyer experiences using Magento to boost your growth. RSVP today! \n\nRegister for free at https://b2bexperience.magento.com\n\nNote: This is a merchant-only event.\n', 'https://b2bexperience.magento.com', 0, 0),
(6, 4, '2017-10-27 05:54:48', 'Last Chance: join us on Nov 2 at the Magento B2B merchant event in Chicago!', 'Transform your business at the Magento B2B Experience on November 2 in Chicago. \n\nNetwork with industry leaders, B2B merchants, and partners to gain insights on B2B best practices, and to discover how to create powerful buyer experiences using Magento to boost your growth. RSVP today! \n\nRegister for free at https://b2bexperience.magento.com\n\nNote: This is a merchant-only event.\n', 'https://b2bexperience.magento.com', 0, 0),
(7, 1, '2017-11-29 13:36:29', 'Magento Open Source 1.9.3.7 Enhances Security - 11/28/2017', 'Magento Open Source 1.9.3.7 includes critical security enhancements. We encourage you to upgrade or patch as soon as is reasonably possible. Review the release notes for more information: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html\n\n', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(8, 4, '2017-12-13 03:00:13', 'Magento Open Source 2.2.2 Accelerates Growth with Instant Purchase Checkout, Integrated Email Marketing Automation, Advanced Reporting, and More – 12/12/2017', 'Our newest release of Magento Open Source equips merchants with powerful tools to accelerate growth and improve operational efficiency. It boosts conversion rates with a streamlined Instant Purchase checkout, jump-starts sales with integrated dotmailer email marketing automation, delivers actionable insights through Advanced Reporting, and provides integrated multi-carrier shipping and fulfillment capabilities with Magento Shipping. https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ', 'https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ', 0, 0),
(9, 4, '2017-12-18 06:54:11', 'Survey: Do you use site personalization and optimization tools? If yes, we\'d to hear from you!', 'We\'d like to invite you to take our online survey on site personalization and optimization tools. Your input is valuable and will help to inform the products we bring to market.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \nhttps://www.surveymonkey.com/r/NF9ZH8D\n\nThank you in advance for your participation.', 'https://www.surveymonkey.com/r/NF9ZH8D', 0, 0),
(10, 4, '2017-12-27 01:24:06', 'Survey: Do you use site personalization tools? If yes, please take our survey.', 'We\'d like to invite you to take our online survey on site personalization and optimization tools. Your input is valuable and will help to inform the products we bring to market.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \nhttps://www.surveymonkey.com/r/NF9ZH8D\n\nThank you in advance for your participation.', 'https://www.surveymonkey.com/r/NF9ZH8D', 0, 0);
