(35, 3, 140, 0, 3, '<h2>Mother\'s Rings</h2> What do you get for the woman who gives you everything? Something thoughtful, personalized and full of memories. Something that reminds her of what’s most important to her. These pieces are made to signify your love, appreciation and respect for the woman who gives you life, love, support and courage. <p> So how do you embody this bond in a ring? Combine all of her children’s birthstones to create a one-of-a-kind jewelry experience. Choose a design that she’ll hold close to her heart. Nature inspires with floral and sprawling ivy to represent the growth of her family – different colored birthstones in the center of each flower for each child and her spouse. Or select a stylized art-deco inspired ring that hugs several gemstones. Will you engrave the names of her beloved? Or perhaps a phrase that she holds dear? Is she a woman who loves the classicism of gold or the modernism of silver? The options are endless so that no matter what, you can create something just right that will complement her endlessly. <p> Mother’s Day is the perfect time to create something unique for Mom, but don’t be afraid to gift her with a touch of opulence at other times – Christmas, birthdays, anniversaries or just because. She deserves it! <br>\r\n					<h2>Featured Mother\'s Ring</h2>\r\n					<table>\r\n						<tr>\r\n							<td width=\"120\">												\r\n								<img width=\"120\" height=\"120\" src=\"http://localhost/public_sc/jewlr/skin/frontend/jwelzhq/default/images/jint0001_B1-5-t2-1024.jpg\">\r\n								\r\n							</td>											\r\n							<td>												\r\n								<a href=\"#\"><h3>Interchangeable Caged Heart Ring with 2-6 Stones</h3></a>												\r\n								These interchangeable cages and bands make this the most exceptionally personalized and one-of-a-kind gift you can give. Choose the cage that most represents the amazing woman who will be wearing it and the band that best suits her style. The large cage size allows space for up to 6 dazzling heart cut birthstones to make the ring even more special!												\r\n							</td>											\r\n						</tr>										\r\n					</table>'),
