INSERT INTO `core_email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(1, 'Invoice', '{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"email-heading\">\r\n                        <h1>Thank you for your order from {{var store.getFrontendName()}}.</h1>\r\n                        <p>You can check the status of your order by <a href=\"{{store url=\"customer/account/\"}}\">logging into your account</a>.</p>\r\n                    </td>\r\n                    <td class=\"store-info\">\r\n                        <h4>Order Questions?</h4>\r\n                        <p>\r\n                            {{depend store_phone}}\r\n                            <b>Call Us:</b>\r\n                            <a href=\"tel:{{var phone}}\">{{var store_phone}}</a><br>\r\n                            {{/depend}}\r\n                            {{depend store_hours}}\r\n                            <span class=\"no-link\">{{var store_hours}}</span><br>\r\n                            {{/depend}}\r\n                            {{depend store_email}}\r\n                            <b>Email:</b> <a href=\"mailto:{{var store_email}}\">{{var store_email}}</a>\r\n                            {{/depend}}\r\n                        </p>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\"order-details\">\r\n            <h3>Your Invoice <span class=\"no-link\">#{{var invoice.increment_id}}</span></h3>\r\n            <p>Order <span class=\"no-link\">#{{var order.increment_id}}</span></p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"order-information\">\r\n        <td>\r\n            {{if comment}}\r\n            <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n                <tr>\r\n                    <td>{{var comment}}</td>\r\n                </tr>\r\n            </table>\r\n            {{/if}}\r\n            {{layout area=\"frontend\" handle=\"sales_email_order_invoice_items\" invoice=$invoice order=$order}}\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"address-details\">\r\n                        <h6>Bill to:</h6>\r\n                        <p><span class=\"no-link\">{{var order.billing_address.format(\'html\')}}</span></p>\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"address-details\">\r\n                        <h6>Ship to:</h6>\r\n                        <p><span class=\"no-link\">{{var order.shipping_address.format(\'html\')}}</span></p>\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                <tr>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"method-info\">\r\n                        <h6>Shipping method:</h6>\r\n                        <p>{{var order.shipping_description}}</p>\r\n                    </td>\r\n                    {{/depend}}\r\n                    <td class=\"method-info\">\r\n                        <h6>Payment method:</h6>\r\n                        {{var payment_html}}\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}', NULL, 2, '{{var store.getFrontendName()}}: Invoice # {{var invoice.increment_id}} for Order # {{var order.increment_id}}', NULL, NULL, '2017-12-27 13:46:25', '2017-12-27 13:46:25', 'sales_email_invoice_template', '{\"store url=\\\"\\\"\":\"Store Url\",\"var logo_url\":\"Email Logo Image Url\",\"var logo_alt\":\"Email Logo Image Alt\",\"htmlescape var=$order.getCustomerName()\":\"Customer Name\",\"var store.getFrontendName()\":\"Store Name\",\"store url=\\\"customer/account/\\\"\":\"Customer Account Url\",\"var invoice.increment_id\":\"Invoice Id\",\"var order.increment_id\":\"Order Id\",\"var order.billing_address.format(\'html\')\":\"Billing Address\",\"var payment_html\":\"Payment Details\",\"var order.shipping_address.format(\'html\')\":\"Shipping Address\",\"var order.shipping_description\":\"Shipping Description\",\"layout area=\\\"frontend\\\" handle=\\\"sales_email_order_invoice_items\\\" invoice=$invoice order=$order\":\"Invoice Items Grid\",\"var comment\":\"Invoice Comment\"}');
